import React from 'react';
import './App.css';
import Headerbar from './Headerbar';

function App() {
  return (
    <div className="App">
      <Headerbar/>
      <button className='advancedSearchButton'>Advanced search</button>
      <div className='App-innerdiv'>
        <Avilable/>
        <Favourites/>
      </div>
    </div>
  );
}

export default App;
